import React from 'react';
import Router from './Router';
import { GlobalStoreProvider, GlobalStore } from 'global-store-hook';

const state = {
  loading: false,
  room_name: '',
  name: '',
  rooms: [],
};

const App = (props) => (
  <GlobalStoreProvider initValues={state}>
    <Router {...props} />
  </GlobalStoreProvider>
);

export default App;
